function[y] = phi_hat(x,M,m,window,n)
% computation of the Fourier transformed window function
% 
% INPUT:
% x ... nodes
% M ... number of Fourier coefficients
% m ... oversampled M
% window ... specification of window function
% n ... cut-off parameter
% 
% OUTPUT:
% y ... values of the Fourier transformed window function at x
% 
% author: Melanie Kircheis

sigma = m/M;
 
switch window
    case 'BSpline'
        y = 1/m .* (my_sinc(pi.*x/m)).^(2*n);
    case 'Gaussian'
        b = 2*sigma/(2*sigma-1)*n/pi;
        y = 1/m*exp(-b*(pi*x/m).^2);
    case 'Sinc'
        y = cardinal_bspline(2*n*x./((2*sigma-1)*M),2*n);
    case 'Kaiser'
        y = zeros(length(x),1);
        b = pi*(2-1/sigma);
        ind = (abs(x./(1-1/(2*sigma))) <= m);
        y(ind) = 1/m*besseli(0,n*sqrt(b^2-(2*pi*x(ind)./m).^2));
    case 'Bessel'
        y = zeros(length(x),1);
        b = pi*(2-1/sigma);
        ind = ( abs(x) <= m*b/(2*pi) );
        y(ind) = 1/m*sinh(n*sqrt(b^2-4*pi^2*x(ind).^2/m^2))./sqrt(b^2-4*pi^2*x(ind).^2/m^2);
        y(not(ind)) = 1/m*n*sinc(n*sqrt(4*pi^2*x(not(ind)).^2/m^2-b^2));
        y(abs(x) == m*b/(2*pi)) = 1/m*n;
    case 'Dirichlet'
        y = ones(size(x));
    otherwise
        error('No suitable window function.\n%s', ...
                'Possible options are: ''BSpline'', ''Gaussian'', ''Sinc'', ''Kaiser'', ''Bessel'' or ''Dirichlet''.')
end%switch

%% Nested functions

function[y] = my_sinc(x)
% Computation of the sinc function at nodes x
% Author: Melanie Kircheis
% 
y = zeros(size(x));
ind = (x == 0);
y(ind) = 1;
y(~ind) = sin(x(~ind))./x(~ind);
end%function


function f = cardinal_bspline(v,order)
% Evaluation of the centered cardinal B-spline of the given order for v
% Author: Franziska Nestler
% 
f = zeros(1,numel(v));

for l = 1:numel(v)
	x = v(l);

	if x<-order/2
		j=0;
	elseif x>=order/2
		j=0;
	else
		j=ceil(x+order/2);
	end%if

	switch order
	case 1 
	switch j 
		case 1; y = my_horner([1.00000000000000000000e+00],x);
		otherwise; y = 0;
