function y = my_horner(a,x)
% Horners method to evaluate a polynomial with coefficients a at points x
% a ... contains coefficient of the polynomial, stored in increasing order of the power of x.
% x ... may be a scalar, vector, or array of any size or shape.
% 
% Author: Franziska Nestler
% 
n = length(a)-1;
y = repmat(a(n+1),size(x));
for i = n:-1:1
	y = y.*x + a(i);
end%for
end%function
end%function